(172, 'Online', 'Podcast interview request', 'Grant Lira <a href=\'mailto:grantlira003@gmail.com\'>(grantlira003@gmail.com)</a>', 'grantlira003@gmail.com', '', '', 0, '2023-11-09', '', '', 'Are you available to come on a podcast as a guest?\r\n\r\nIf so, our firm will book you on a podcast within one week.\r\n\r\nIf you’re available to do this, I’d also like to repurpose the content from your podcast to provide you and your business, online article features, and video content for social media. \r\n\r\nPlacing you on podcasts does require an expense, but the online media features and the repurposed video content we will provide completely on us because this is our first time working together :). \r\n\r\nWe are doing this for the first 10 people who reply back to us who qualify because it takes up a good amount of our team\'s time.\r\n\r\nThe one thing I ask is that you tell me if your business is NOT doing 7+ figures.\r\n\r\nI reached out to you because I think you have a 7+ figure business. Most of the hosts that we have connections with are looking for 7+ figure business owners to interview.\r\n\r\nI want to make sure we don’t lie to them so let me know if you are not.\r\n\r\nSo, if you qualify, and want to be booked on a podcast you can chat with our Co-Founder here:\r\n\r\nhttps://bit.ly/empathyfirm-podcast\r\nBest,\r\nGrant\r\nPS - I won’t see your response on here so if you have a question, please book a call (:\r\n\r\n\r\n\r\n\r\nN6565 Shorewood Hills Rd. Lake Mills WI, 53551\r\nEmail unsubnow1@gmail.com with your website to “unsubscribe” meaning you won’t hear from me again.\r\n (Sent from online front site)', ''),
(173, 'Online', 'Наши Услуги: Путь к Высококачественным и Комфортным Решениям\"', 'LowellJag <a href=\'mailto:pet.r.o.s.er.gy.e@gmail.com\'>(pet.r.o.s.er.gy.e@gmail.com)</a>', 'pet.r.o.s.er.gy.e@gmail.com', '', '', 0, '2023-11-11', '', '', '1. Многообразие Предложений \r\n \r\nНаши услуги охватывают широкий спектр областей, от удобных онлайн-сервисов до специальных заключений. Будь то онлайн-покупки, образовательные курсы, медицинские консультации или увеселительные платформы, мы рвемся ублаготворить разнообразные необходимости наших юзеров. \r\n \r\n2. Удобство и Эффективность <a href=https://sportschool.md/>https://sportschool.md/</a> \r\n \r\n \r\nОдним из наших приоритетов считается передача предложений, которые сберегают ваше время и проделывают вашу жизнь легче. Онлайн-заказы, быстрые транзакции, удобные графики работы - все это спроектировано  чтобы, дабы вы имели возможность получить то,  собственно что вам нужно, без лишних хлопот. \r\n \r\n3. Качество и Надежность \r\n \r\nМы рвемся предоставлять лишь только высококачественные услуги, которые отвечают вашим ожиданиям и эталонам. Наша команда тщательно отбирает партнеров и поставщиков, чтобы гарантировать вам надежность и безопасность в каждой сделке. \r\n \r\n4. Личный Подход \r\n \r\nМы осознаем, что каждый пользователь уникален, и потому разрабатываем наши услуги с учетом вашего индивидуального навыка. Гибкие опции, персонализированные рекомендации и внимание к вашим предпочтениям - вот что творит наши предложения действительно индивидуальными. \r\n \r\n5. Инновации и Технологии \r\n \r\nСледуя за передовыми тенденциями, мы внедряем инноваторские технологии, дабы обеспечить вас современными и комфортными решениями. Это включает в себя безопасные платежные системы, умные советы, и прогрессивные онлайн-инструменты. \r\n \r\n6. Бережливость Ресурсов \r\n \r\nМы ценим ваше время, средства и усилия. Наши предложения разработаны так, чтобы помогать для вас экономить ресурсы и создавать вашу жизнь более плодоносящей и комфортной. \r\n \r\n7. Систематическое Становление \r\n \r\nМы постоянно трудимся над улучшением наших услуг, добавляя свежие способности и следуя за потребностями наших пользователей. Ваши отзывы и предложения являются для нас ценным ресурсом, помогая совершенствовать наши сервисы. \r\n \r\n8. Доверие и Проницаемость \r\n \r\nМы стремимся к открытому и прозрачному взаимодействию с нашими юзерами. Вам продоставляется возможность быть убеждены  что,  собственно что мы ценим ваше доверие и готовы предоставить вам всю нужную информацию о наших предложениях. \r\n \r\nКороче говоря, наши предложения сделаны с мыслью о вас - наших юзеров. Мы рвемся создавать вашу жизнь легче, комфортнее и насыщеннее. Пользуйтесь нашими предложениями, чтобы обрести свежий степень ублажения и убежденности в каждом аспекте вашей жизни. (Sent from online front site)', ''),
